  }
 else {
    this.internalPool=new GenericObjectPool<Jedis>(new JedisFactory(host,Protocol.DEFAULT_PORT,Protocol.DEFAULT_TIMEOUT,null,Protocol.DEFAULT_DATABASE,null),new GenericObjectPoolConfig());
  }
}
